// SPDX-License-Identifier: MIT
import './StringUtil.sol';
pragma solidity >=0.8.17 ;
contract HelloWorld{
    string myIntro = "Hello World! My name is Zhou Yanan.";
    //用view而不能pure
    function myFirstHelloWorld() public view virtual returns(string memory){
        return myIntro;

    }
}

contract HelloMyWorld is HelloWorld{
    using StringUtil for *;
    
    function  myFirstHelloWorld() public view override returns(string memory){
        string memory str0 = "Hello World! My name is Zhang San.";
        string memory tempStr = super.myFirstHelloWorld();
        
        if(StringUtil.compare(tempStr,str0)==StringUtil.CompareResult.Equal){
            return "It's not me!";

        }
        else{
            return string.concat(tempStr,"My class number is 202.");
        }
           
    }
}

