// SPDX-License-Identifier: MIT
pragma solidity >=0.8.16 ;

//实例测试
contract StringUtilTest{
    using StringUtil for *;  
    // 为什么部署后没有cpt函数
    function cpt(string memory t1,string memory t2) public pure returns (StringUtil.CompareResult){
        return StringUtil.compare(t1, t2);     
    }
}

//为什么用contract就可以运行(且返回值是对应的index)
/*但是library就返回错误的值 (error:Failed to decode output: 
Error: invalid type (argument="type", value="StringUtil.CompareResult", 
code=INVALID_ARGUMENT, version=abi/5.5.0))*/
library StringUtil{
    enum CompareResult {Equal,Less,Greater,Invalid}    //枚举
  
    //在solidity中，字符串是一组存储在数组中的字符，以字节为单位存储数据。
    //在字符串类型中没有长度方法。

    function compare(string memory t1, string memory t2) public pure returns(CompareResult){
        //转化成bytes类型获取字节长度--这里得到的bytes存储的是每个字符的十六进制 例如a:0x61
        bytes memory tb1 = bytes(t1);
        bytes memory tb2 = bytes(t2);
        bool tb1_tb2_bool = tb1.length <= tb2.length;
        //取更小的一个
        uint  s_small = tb1_tb2_bool ? tb1.length:tb2.length;

        //compare函数返回值是Invalid的条件：输入参数字符串str1、字符串str2任意一个参数是空字符串。
        if(tb1.length==0 || tb2.length==0){
            return CompareResult.Invalid;
        }
        //compare函数返回值是Equal的条件：输入参数字符串str1与字符串str2内容相同；
        else if((tb1.length == tb2.length) && keccak256(bytes(t1))==keccak256(bytes(t2))){
            return CompareResult.Equal;
        }
        /*
        compare函数返回值是Less的条件：从str1、str2的第一个字符开始比较，一旦str1的字符ascii码值小于str2对应位置的字符ascii码值；或者str1的长度小于str2的长度且字符串str1与字符串str2[0, str1.length]字符串内容相同；
2.4 compare函数返回值是Greater的条件：从str1、str2的第一个字符开始比较，一旦str1的字符ascii码值大于str2对应位置的字符ascii码值；或者str1的长度大于str2的长度且字符串str2与字符串str1[0, str2.length]字符串内容相同；
         */
        else{      
            for (uint256 i = 0; i < s_small; i++) {
                if(tb1[i]>tb2[i]){
                    return CompareResult.Greater;
                 }
                if(tb1[i]<tb2[i]){
                    return CompareResult.Less;
                }
            }
            //前面都一样则返回比较值
            return  (tb1_tb2_bool ? CompareResult.Less : CompareResult.Greater);
        }
    }
}

